import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import prescription from './components/prescription/prescription';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/prescription" element={<prescription />} />
    </Routes>

    </BrowserRouter>

  );
}

export default App;
